const axios = require('axios')



export const getCoffeeShopLocations = (setCoffeeShops, userLocation) => {
    axios.get(`/locations/?user_locations=${userLocation.lat},${userLocation.lng}`)
        .then((res) => {
            setCoffeeShops(res.data)
        })
}
